import React from 'react';
import Card from './Card.js';
import User from './User';
import './UsersList.css';
import './User.css';

const UsersList = function(props) {
    return (
        <Card className="users"> 
            <ul>
                {props.items.map((user) => (
                  <User
                    id={user.id}
                    img={user.img}
                    age={user.age}
                    major={user.major}
                   />
                ))}
            </ul>
        </Card>
    );
}

export default UsersList;
